function [sys,x0,str,ts] = ControlSMRG(t,x,u,flag,PI_n,rho_n,mu_n,lambda,delta,eta,IN)
switch flag
case 0
[sys,x0,str,ts]=mdlInitializeSizes;
case 3
sys=mdlOutputs(t,x,u,PI_n,rho_n,mu_n,lambda,delta,eta,IN);
case {2,4,9}
sys=[];
otherwise
error(['Unhandled flag = ',num2str(flag)]);
end

function [sys,x0,str,ts]=mdlInitializeSizes
